import React, { useState } from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";

function App() {

  return (    <Router>
            <Switch>
            <Route to="/" exact component={Image} />
            <Route to="/" exact component={Definition} />
            <Route to="/" exact component={Pronunce} />
            <Route to="/" exact component={Save} />
            </Switch>
            </Router>
         ) 
}

export default App;
